import React from 'react';
const Navbar = () => {
    return ( 
        <div className="">
        <nav className="navbar navbar-expand-sm">
            
                <ul className="navbar-nav mx-auto">
                    <Link to="/" className="nav-link" style=
                    {{color:'black',textDecoration:'none'}}>
                        <li className="nav-item">HOME</li></Link>
                    <a href="" className="nav-link" style={{color:"black"}}><li className="nav-item">ABOUT</li></a>
                    <a href="" className="nav-link" style={{color:"black"}}><li className="nav-item">CONTACT</li></a>
                    <a href="" className="nav-link" style={{color:"black"}}><li className="nav-item">SERVICES</li></a>
                </ul>
        </nav>
        
            <hr style={{color:"black",width:"900px",marginLeft:"200px"}}/>
        
        </div> 
     );
}
 
export default Navbar;
